    /*---Fields---*/
    private String svgPath;
    private int code;
    private Orientation orientation;

    enum Orientation {
        VERTICAL, ORIZONTAL;
    }

    /*---Constructors---*/
    ProfileImagePreset(String path, int imgCode, Orientation orientation) {
        this.svgPath = path;
        this.code = imgCode;
        this.orientation = orientation;
    }

    /*---Methods---*/
    public String getSvgPath() {
        return svgPath;
    }

    public int getCode() {
        return code;
    }

    public static ProfileImagePreset getByCode(int code) {
        for(ProfileImagePreset im : values()) {
            if (im.getCode() == code) {
                return im;
            }
        }
        return null;
    }

    public Orientation getOrientation() {
        return orientation;
    }
